(130, 1, 'Why You Should Take a Hawaii Vacation This Year', '<p>\r\n	<strong>E Komo Mai! </strong>This is how you will be greeted when you arrive in Hawaii. It means Welcome. Hawaii is now a direct flight from any city in the USA or Canada. It has the most amazing weather that go right along with the great beaches.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Hawaii Activities</strong></p>\r\n<p>\r\n	Everyone in the world no matter where they live finds that they want to visit Hawaii at least once for a vacation the thought of the Pacific Island and a taste of paradise is what everyone wants. The main islands of Hawaii that you are able to visit are Maui, Oahu, Kauai, Molokai and the Big Island. They have the most amazing beaches and great accommodation and the warm sun.</p>\r\n<p>\r\n	If you&rsquo;re looking to take a trip to Hawaii anywhere from November to April then don&#39;t forget to grab a tour boat trip that offers whale watching. You will be able to get very close so don&#39;t forget you camera. Also while on board don&#39;t forget that you also get a good chance of see bottle nose or spinner dolphins. Certain boat also provide shark encounter.</p>\r\n<p>\r\n	If you have always wanted to learn how to scuba dive don&#39;t worry because every island has operators that provide scuba lessons.</p>\r\n<p>\r\n	If you prefer to do a little less deep swimming then try snorkeling. Hawaii has many safe places for just that have a amazing category of tropical fish and a underwater experience that no one should miss.</p>', '', 74, 'Why You Should Take a Hawaii Vacation This Year', '<p>\r\n	<strong>E Komo Mai! </strong>This is how you will be greeted when you arrive in Hawaii. It means Welcome. Hawaii is now a direct flight from any city in the USA or Canada. It has the most amazing weather that go right along with the great beaches.</p>', '');
