(5671, 'Sales Results Report days', 'RCS_REPORT_DAYS', '90', 'Number of days the sales results report takes into account. The more days the longer the SQL queries!.', 6501, 15, '0000-00-00 00:00:00', '2009-11-04 15:53:49', '', ''),
(5672, 'Use Calculated taxes', 'RCS_INCLUDE_TAX_IN_PRICES', 'false', 'Try to calculate the taxes when determining prices. This may not be 100% correct as determing location being shopped from, etc. may be incorrect.', 6501, 16, '0000-00-00 00:00:00', '2009-11-04 15:53:49', '', 'tep_cfg_select_option(array(''true'', ''false''),'),
(5673, 'Use Fixed tax rate', 'RCS_USE_FIXED_TAX_IN_PRICES', 'false', 'Use a fixed tax rate when determining prices (rate set below). Overridden if ''Use Calculated taxes'' is true.', 6501, 17, '0000-00-00 00:00:00', '2009-11-04 15:53:49', '', 'tep_cfg_select_option(array(''true'', ''false''),'),
(5674, 'Fixed Tax Rate', 'RCS_FIXED_TAX_RATE', '.10', 'The fixed tax rate for use when ''Use Fixed tax rate'' is true and ''Use Calculated taxes'' is false.<br><br>Use decimal values, ie: 0.10 for 10% ', 6501, 18, '0000-00-00 00:00:00', '2009-11-04 15:53:49', '', ''),
(5675, 'E-Mail time to live', 'RCS_EMAIL_TTL', '90', 'Number of days to give for emails before they no longer show as being sent', 6501, 20, '0000-00-00 00:00:00', '2009-11-04 15:53:49', '', ''),
(5676, 'Friendly E-Mails', 'RCS_EMAIL_FRIENDLY', 'true', 'If <b>true</b> then the customer''s name will be used in the greeting. If <b>false</b> then a generic greeting will be used.', 6501, 30, '0000-00-00 00:00:00', '2009-11-04 15:53:49', '', 'tep_cfg_select_option(array(''true'', ''false''),'),
(5677, 'E-Mail Copies to', 'RCS_EMAIL_COPIES_TO', '', 'If you want copies of emails that are sent to customers by this contribution, enter the email address here. If empty no copies are sent', 6501, 35, '0000-00-00 00:00:00', '2009-11-04 15:53:49', '', ''),
(5678, 'Show Attributes', 'RCS_SHOW_ATTRIBUTES', 'false', 'Controls display of item attributes.<br><br>Some sites have attributes for their items.<br><br>Set this to <b>true</b> if yours does and you want to show them, otherwise set to <b>false</b>.', 6501, 40, '0000-00-00 00:00:00', '2009-11-04 15:53:49', '', 'tep_cfg_select_option(array(''true'', ''false''),'),
(5679, 'Ignore Customers with Sessions', 'RCS_CHECK_SESSIONS', 'false', 'If you want the tool to ignore customers with an active session (ie, probably still shopping) set this to <b>true</b>.<br><br>Setting this to <b>false</b> will operate in the default manner of ignoring session data &amp; using less resources.', 6501, 40, '0000-00-00 00:00:00', '2009-11-04 15:53:49', '', 'tep_cfg_select_option(array(''true'', ''false''),'),
(5680, 'Current Customer Color', 'RCS_CURCUST_COLOR', '0000FF', 'Color for the word/phrase used to notate a current customer<br><br>A current customer is someone who has purchased items from your store in the past.', 6501, 50, '0000-00-00 00:00:00', '2009-11-04 15:53:49', '', ''),
(5681, 'Uncontacted hilight color', 'RCS_UNCONTACTED_COLOR', '9FFF9F', 'Row highlight color for uncontacted customers.<br><br>An uncontacted customer is one that you have <i>not</i> used this tool to send an email to before.', 6501, 60, '0000-00-00 00:00:00', '2009-11-04 15:53:49', '', ''),
(5682, 'Contacted hilight color', 'RCS_CONTACTED_COLOR', 'FF9F9F', 'Row highlight color for contacted customers.<br><br>An contacted customer is one that you <i>have</i> used this tool to send an email to before.', 6501, 70, '0000-00-00 00:00:00', '2009-11-04 15:53:49', '', ''),
(5683, 'Matching Order Hilight', 'RCS_MATCHED_ORDER_COLOR', '9FFFFF', 'Row highlight color for entrees that may have a matching order.<br><br>An entry will be marked with this color if an order contains one or more of an item in the abandoned cart <b>and</b> matches either the cart''s customer email address or database ID.', 6501, 72, '0000-00-00 00:00:00', '2009-11-04 15:53:49', '', ''),
(5684, 'Skip Carts w/Matched Orders', 'RCS_SKIP_MATCHED_CARTS', 'true', 'To ignore carts with an a matching order set this to <b>true</b>.<br><br>Setting this to <b>false</b> will cause entries with a matching order to show, along with the matching order''s status.<br><br>See documentation for details.', 6501, 80, '0000-00-00 00:00:00', '2009-11-04 15:53:49', '', 'tep_cfg_select_option(array(''true'', ''false''),'),
(5685, 'Autocheck "safe" carts to email', 'RCS_AUTO_CHECK', 'true', 'To check entries which are most likely safe to email (ie, not existing customers, not previously emailed, etc.) set this to <b>true</b>.<br><br>Setting this to <b>false</b> will leave all entries unchecked (must manually check entries to send an email to)', 6501, 82, '0000-00-00 00:00:00', '2009-11-04 15:53:49', '', 'tep_cfg_select_option(array(''true'', ''false''),'),
(5686, 'Match orders from any date', 'RCS_CARTS_MATCH_ALL_DATES', 'true', 'If <b>true</b> then any order found with a matching item will be considered a matched order.<br><br>If <b>false</b> only orders placed after the abandoned cart are considered.', 6501, 84, '0000-00-00 00:00:00', '2009-11-04 15:53:49', '', 'tep_cfg_select_option(array(''true'', ''false''),'),
(5687, 'Lowest Pending sales status', 'RCS_PENDING_SALE_STATUS', '1', 'The highest value that an order can have and still be considered pending. Any value higher than this will be considered by RCS as sale which completed.<br><br>See documentation for details.', 6501, 85, '0000-00-00 00:00:00', '2009-11-04 15:53:49', 'tep_get_order_status_name', 'tep_cfg_pull_down_order_statuses('),
(5688, 'Report Even Row Style', 'RCS_REPORT_EVEN_STYLE', 'dataTableRow', 'Style for even rows in results report. Typical options are <i>dataTableRow</i> and <i>attributes-even</i>.', 6501, 90, '0000-00-00 00:00:00', '2009-11-04 15:53:49', '', ''),
(5689, 'Report Odd Row Style', 'RCS_REPORT_ODD_STYLE', '', 'Style for odd rows in results report. Typical options are NULL (ie, no entry) and <i>attributes-odd</i>.', 6501, 92, '0000-00-00 00:00:00', '2009-11-04 15:53:49', '', ''),
